import React, { Component } from 'react';
import logo from '../assets/images/LOGOPRO.png';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {faUsers} from '@fortawesome/free-solid-svg-icons';
import {faUtensils} from '@fortawesome/free-solid-svg-icons';
import {faAppleAlt} from '@fortawesome/free-solid-svg-icons';
import {Link} from 'react-router-dom';









class Main extends Component {
    render() {

        return (
            <React.Fragment>

<Navbar bg="light" expand="lg">
      <Container>
        
        <Navbar.Brand href="/main">Restaurant SIGLO XXI</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
      
          &nbsp; 
            <NavDropdown title="Matenedores" id="basic-nav-dropdown">
              <NavDropdown.Item href="/dashboard"><strong>Usuarios</strong>&nbsp; &nbsp;<FontAwesomeIcon id="usersi" icon={faUsers} className="fa-bounce"/></NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="/productos">
              <strong>Productos </strong>  &nbsp;&nbsp;<FontAwesomeIcon id="apple" icon={faAppleAlt} className="fa-bounce" />
              </NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="/menus"><strong>Menus</strong>  &nbsp;&nbsp;<FontAwesomeIcon  id="servis" icon={faUtensils} className="fa-bounce"/></NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="/mesas">
              <strong>Mesas</strong> &nbsp;&nbsp;
              </NavDropdown.Item>
              
            </NavDropdown>
            
          </Nav>
          <Link to="/logout">Cerrar sesi√≥n</Link>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  
   
            <div id="fondito" >
            <img id="test" src={logo} width="340px" style={{marginLeft:"430px", marginTop:"120px"}}  alt="logotipo" />
            <br/>
            <br/>

            </div>
       
         
            </React.Fragment>
            
        );
    }
}

export default Main;
